import React from "react";
const Documentation = () => {
	return (
		<div class="topnav">
			<a class="active" href="#home">
				Home
			</a>
			<a href="#news">Documentation</a>
			<a href="#about">About</a>
		</div>
	);
};
export default Documentation;
